create database training;

/*---------------------------------------------------------------------------
create table CUSTOMERS
-----------------------------------------------------------------------------*/

drop table customers;

create table customers(
customer_id varchar(50) not null primary key,
first_name varchar(350) not null,
last_name varchar(350) not null,
age int not null,
address varchar(1000) not null,
email  varchar(500) not null,
phone_number varchar(150) not null,
country  varchar(350) not null,
city  varchar(350) not null,
state varchar(350) not null,
postal_code  varchar(350) not null,
status_id int not null,
created timestamp default now(),
constraint fl_status_customers foreign key (status_id) references status(status_id)
);


