create table status(
status_id serial primary key not null,
description varchar(250) not null,
created timestamp default now()
);


select * from status;


create table department(
department_id serial primary key not null,
deparment_name varchar(250) not null,
status_id int not null,
created timestamp default now(),
constraint fl_status_department foreign key (status_id) references status(status_id)
);




create table employee(
employee_id serial primary key not null,
first_name varchar(250) not null,
last_name varchar(250) not null,
age int not null,
salary  numeric(15,6),
address varchar(1000) not null,
email  varchar(500) not null,
phone_number varchar(150) not null,
country  varchar(350) not null,
city  varchar(350) not null,
state varchar(350) not null,
postal_code  varchar(350) not null,
department_id int not null,
status_id int not null,
created timestamp default now(),
constraint fk_deparment_employee foreign key (department_id) references department(department_id),
constraint fl_status_employee foreign key (status_id) references status(status_id)
);


select * from employee 


create table product(
product_id serial not null primary key,
name varchar(500) not null,
pricer_per_unit numeric(15,6) not null,
tax_percentage numeric(15,6) not null,
status_id int not null,
created timestamp default now(),
constraint fl_status_product foreign key (status_id) references status(status_id)
);





create table stocks(
stock_id serial not null primary key,
product_id int not null,
in_stock int not null,
status_id int not null,
created timestamp default now(),
constraint fl_stocks_product foreign key (product_id) references products(product_id),
constraint fl_status_product foreign key (status_id) references status(status_id)
);





create table invoices(
invoice_id serial not null primary key,	
customer_id varchar(50) not null,
amount numeric(15,6) not null,
tax_amount numeric(15,6) not null,
total_amount numeric(15,6) not null,
status_id int not null,
created timestamp default now(),
constraint fl_invoices_customers foreign key (customer_id) references customers(customer_id),
constraint fl_invoices_status foreign key (status_id) references status(status_id)
);


create table invoices_items(
invoices_items_id serial not null primary key,
invoice_id int not null,
product_id int not null,
amount numeric(15,6) not null,
tax_amount numeric(15,6) not null,
sub_amount numeric(15,6) not null,
total_amount numeric(15,6) not null,
status_id int not null,
created timestamp default now(),
constraint fl_invoices_items_invoices foreign key (invoice_id) references invoices(invoice_id),
constraint fl_invoices_items_product foreign key (product_id) references products(product_id),
constraint fl_invoices_items_status foreign key (status_id) references status(status_id)
);

